def new_year_gifts(n, f):
    for i in range(len(f)):
        if f[i] == 0:
            for j in range(len(f)):
                if f[j] == 0 and i != j:
                    f[i] = j+1
                    f[j] = i+1
                    break
    return f

n = int(input())
f = list(map(int, input().split()))
print(*new_year_gifts(n, f))

